def str_str(haystack, needle)
	return 0 if needle == nil or needle == ""

	firstHash = {}
	(0...haystack.size).each do |index|
		firstHash[haystack[index]] = true
	end

	(0...needle.size).each do |index|
		return -1 if firstHash[needle[index]] == nil
	end

	(0...haystack.size).each do |firstIndex|
		flag = true
		(0...needle.size).each do |secondIndex|
			if haystack[firstIndex + secondIndex] == needle[secondIndex]
				next
			else
				# print firstIndex, ' ', secondIndex, haystack[firstIndex + secondIndex], needle[secondIndex], "\n"
				flag = false
				break
			end
		end
		if flag
			return firstIndex
		end
	end

	-1
end

puts str_str("hello", "ll")
puts str_str("aaaaa", "bba")
puts str_str("", "")

